        axios.post(`https://2yubi.shop/api/logout`)
        .then((res)=>{
          console.log('donggg',res)
        })
        .catch((err)=>{
          console.log(err)
        })
      }

  return (

    <div>


   <Button onClick={server}>로그아웃</Button>


    <div style={{display:'flex'}}>

    {user.map((v,index)=>(
        <div>
